import React, { Component } from "react";
import "../css/Service.css";

const Service = (props) => {
  return (
    <section id="services" class="parallax-section">
        <div class="container">
            <div class="titleServices">
				<div class="titleServices2">
					<h2 class="title-one">Dịch vụ</h2>
					<p>Chúng tôi đã xây dựng website chấm code online cho phép các bạn có thể nộp code, chạy code online và đưa ra kết quả đúng sai ngay. Người học sẽ biết được mình đúng hay sai, sai ở những test nào, từ đó có thể rút kinh nghiệm và cải thiện code của mình một cách nhanh chóng, phù hợp.</p>
				</div>
			</div>
        </div>
    </section>
  )
};

export default Service;
